newCallback_Greet_shutdown(T* instance, void (T::*excb)(const ::Ice::Exception&, const CT&), void (T::*sentcb)(bool, const CT&) = 0)
{
    return new Callback_Greet_shutdown<T, CT>(instance, 0, excb, sentcb);
}

